    false,nt"url": null,nt"notes": "Data for scleractinian corals and other
    cnidarians were acquired during in situ surveys at National Wildlife Refuges and
    Marine National Monuments in the U.S. Pacific between 2000 and 2012. The surveys
    were conducted in association with the NOAA vessels Townsend Cromwell (2000-2002),
    Oscar Elton Sette (2003-2004), and Hiu2019ialakai (2004-2010); NOAA charter vessel
    American Islander (2001); Northwestern Hawaiian Islands Coral Reef Ecosystem Reserve
    charter vessel Rapture (2000 and 2002), and island/atoll-specific visits by U.S.
    Fish & Wildlife Service. Individual data files are included for: Johnston Atoll,
    Howland Island, Baker Island, Jarvis Island, Palmyra Atoll, Kingman Reef, Rose Atoll,
    and 11 locations in the Northwestern Hawaiian Islands (Nihoa, Necker, French Frigate
    Shoals, Gardner Pinnacles, Raita Bank, Maro Reef, Laysan, Lisianski, Pearl & Hermes
    Atoll, Midway Atoll, and Kure Atoll). Most data files include: an inventory of species
    reported during each survey year; assessments of the relative abundance of each
    species; size class data; a brief explanation of data fields; GPS coordinates for
    each site; and graphs based on selected data sets. Some data files also include
    historical (pre-2000) species records.",nt"license_title": "License Not Specified",nt"extras":
